        [HttpGet]
        public async Task<JsonResult<List<Uri>>> UipGetAll()
        {
            var provider = new StorageUserImagesProvider();
            var container = await provider.GetContainer("user");
            var uris = provider.GetAllBlobs(container);
            return Json(uris);
        }
        [HttpGet]
        public async Task<JsonResult<List<Uri>>> UipUpload()
        {

            var provider = new StorageUserImagesProvider();
            await provider.UploadAsyncByAbsoluteUrl(getTestFileToLoad(), "https://skagryuserimages.blob.core.windows.net/user/2/test.jpg");
            return await UipGetAll();
        }

