        [HttpGet]
        //IS EXAMPLE Step by step
        public async Task<string> SavaAndREsizeImageToStorage()
        {
            var source = ImageTypes.Base64ToImage(testUploadBase64Image);
            var detail = new ImageResizer().ResizeImage(source, new RectangleF(0, 0, 260, 260));
            var icon = new ImageResizer().ResizeImage(source, new RectangleF(0, 0, 107, 107));

            var pr = new StorageUserImagesProvider();
            var urls = Avatar.CreateFileUrls(1001);
            var sourceStream = new MemoryStream();
            source.Save(sourceStream, ImageFormat.Jpeg);
            sourceStream.Position = 0;
            await pr.UploadAsyncByAbsoluteUrl(sourceStream, urls.Source);
            
            var detailStream = new MemoryStream();
            detail.Save(detailStream, ImageFormat.Jpeg);
            detailStream.Position = 0;
            await pr.UploadAsyncByAbsoluteUrl(detailStream, urls.Detail);

            var iconStream = new MemoryStream();
            icon.Save(iconStream, ImageFormat.Jpeg);
            iconStream.Position = 0;
            await pr.UploadAsyncByAbsoluteUrl(iconStream, urls.Icon);

            source.Dispose();
            sourceStream.Close();

            detail.Dispose();
            detailStream.Close();

            icon.Dispose();
            iconStream.Close();


            return "ok";
        }

        private MemoryStream getTestFileToLoad()
        {

            byte[] imageBytes = System.Convert.FromBase64String(testUploadBase64Image);
            return new MemoryStream(imageBytes, 0, imageBytes.Length);

        }



        //http://www.motobit.com/util/base64-decoder-encoder.asp

